import React from 'react';
import "./css/watchparty.css";

const Host = () => {
	return (
		<>
			<body class="home">
				<div>
					<div class="title_text">
						<h1 class="title">hier soll dan der raumname hin am besten</h1>
					</div>
					<div class="welcome_text">
						<Player ref={(player) => { this.player = player }}>
							<source src="https://media.w3.org/2010/05/sintel/trailer_hd.mp4" />
						</Player>
					</div>
					<div >
						<input type="text" name="roomname" class="input_box" placeholder="Raumnamen eingeben"></input>
						<button onClick={event => window.location.href = '/Watchparty'} className="submit_button">Raum erstellen</button>
					</div>
				</div>
			</body>
		</>
	);
};

export default Host;
